        const ok = window.confirm("삭제하시겠습니까?")
    }


    return (
        <div>       
            <h4>{nweetObj.text}</h4>
            {isOwner && (
                <>
                    <button>Delete Nweet</button>
                    <button>Edit Nweet</button>
                </>
